import React from 'react';

const Header = (

  <div class="header">
    <div class="bounds">
      <h1 class="header--logo">Courses</h1>
      <nav><a class="signup" href="sign-up.html">Sign Up</a><a class="signin" href="sign-in.html">Sign In</a></nav>
    </div>
  </div>
);

export default Header;
